import React, { useState } from 'react';
import axios from 'axios';
import { TextField, Button, Dialog, DialogActions, DialogContent, DialogTitle } from '@mui/material';

interface AddWorkoutProps {
  open: boolean;
  handleClose: () => void;
  onWorkoutAdded: () => void;
}

const AddWorkout: React.FC<AddWorkoutProps> = ({ open, handleClose, onWorkoutAdded }) => {
  const [type, setType] = useState('');
  const [duration, setDuration] = useState('');
  const [caloriesBurned, setCaloriesBurned] = useState('');

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();

    const newWorkout = { type, duration: Number(duration), caloriesBurned: Number(caloriesBurned) };

    axios.post('http://localhost:5000/workouts', newWorkout)
      .then(() => {
        onWorkoutAdded();
        handleClose();
      })
      .catch(error => {
        console.error('There was an error adding the workout!', error);
      });
  };

  return (
    <Dialog open={open} onClose={handleClose}>
      <DialogTitle>Add Workout</DialogTitle>
      <DialogContent>
        <form onSubmit={handleSubmit}>
          <TextField
            label="Type"
            fullWidth
            margin="normal"
            value={type}
            onChange={(e) => setType(e.target.value)}
          />
          <TextField
            label="Duration (minutes)"
            type="number"
            fullWidth
            margin="normal"
            value={duration}
            onChange={(e) => setDuration(e.target.value)}
          />
          <TextField
            label="Calories Burned"
            type="number"
            fullWidth
            margin="normal"
            value={caloriesBurned}
            onChange={(e) => setCaloriesBurned(e.target.value)}
          />
          <DialogActions>
            <Button onClick={handleClose} color="secondary">
              Cancel
            </Button>
            <Button type="submit" color="primary">
              Add
            </Button>
          </DialogActions>
        </form>
      </DialogContent>
    </Dialog>
  );
};

export default AddWorkout;
